  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for National Elk
  Refuge outlines Refuge accomplishments from May through August of 1945. The report
  begins by summarizing the weather conditions, water conditions, and wildfires during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  predators, raptors, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments and plantings. The public relations section
  discusses Refuge visitors and violations. N-R forms are attached.\",\n\t\"owner_org\":
